<script setup>
import axios from 'axios'

async function EventVote(numberOfEvent){
    var nomination = "event"
    var electorIp = 0
    await fetch("https://api.ipify.org?format=json")
                .then(response => response.json())
                .then(data => {
                    // Display the IP address on the screen
                    electorIp = data.ip;
                    console.log(data.ip)
                })
                .catch(error => {
                    console.error("Error fetching IP address:", error);
                });
    const data = {
        "id": numberOfEvent,
        "nomination": nomination,
        "elector-ip": electorIp
    }
    const response = (await axios.post("http://127.0.0.1:8000/record_vote", data)).data
    console.log(response.success)
    if(response.success){
        window.location.href = "/voted"
    }
    else{
        window.location.href = "/alreadyvoted"
    }
}

function Back(){
    window.location.href = '../'
}
</script>
